    isUp: boolean
}

const Arrow: React.FC<TProps> = React.memo(({isUp = false}) => {


    const arrowClasses = classNames({
        [styles.arrow]: true,
        [styles.up]: isUp,
        [styles.down]: !isUp
    })

    return <div className={arrowClasses}></div>
})

export default Arrow
